// import the library
import { library } from '@fortawesome/fontawesome-svg-core';

// import your icons
import { 
  faPlus, faPlusCircle, faBars
  } from '@fortawesome/free-solid-svg-icons';

library.add(
  faPlus,
  faPlusCircle,
  faBars,
);
